import React from "react";
import "./App.css";
import Navbar from "./components/navbar/index.js";
import Schedule from "./components/pages/schedule/index";
import PatientDemographic from "./components/pages/patientDemographics";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Schedule />
      <PatientDemographic />
    </div>
  );
}

export default App;
